import React from 'react';
import PropTypes from 'prop-types';
import FormItem from '../../../../shared/Form/FormItem/FormItem';
import Input from '../../../../shared/Input/Input';
import { Link } from 'react-router-dom';
import { ROUTES } from '../../../../../config/constants';
import Button from '../../../../shared/Button/Button';

const ConnectNotification = props => {
    return (
        <div>
            {/*<h2 className='mb-7 text-2xl font-medium text-gray-800'>Enter Telegram ID</h2>*/}
            <p className='text-gray-700 text-xl mb-5'>You have already enabled Telegram notifications</p>
            <div className='flex items-center'>
                <span className='mr-5'>Telegram ID:</span>
                <span>123456789</span>
            </div>

            <div className='flex justify-center'>
                <Link to='#'>
                    <Button type={'primary'} className={'bg-indigo-600'}>
                        Disconnect
                    </Button>
                </Link>
            </div>
        </div>
    );
};

ConnectNotification.propTypes = {};

export default ConnectNotification;
